import React from 'react';

const ButtonReserva = ({ type = 'button', onClick, children, className = '', ...props }) => {
  return (
    <button
      type={type}
      onClick={onClick}
      className={`btn ${className}`}
      {...props}
    >
      {children}
    </button>
  );
};

export default ButtonReserva;
